import React from 'react';

const HistorySelector = React.memo(function HistorySelector(props) {
  const historyList = [];
  for (var i = 0; i < localStorage.length; i++){
    if (localStorage.key(i).includes('wapp-')) {
      historyList.push(localStorage.key(i).split("_").pop())
    }
    // $('body').append(localStorage.getItem(localStorage.key(i)));
  }

  let options = historyList.map((data) =>
                <option 
                    key={data.id}
                    value={data.id}
                >
                    {data.name}
                </option>
            );

  return(
      <div>
        <select id="city" onChange={props.handleSelect}>
          <option>Select Item</option>
          {options}
        </select>
      </div>
  );
});

export default HistorySelector;
